import React, { Component } from 'react'
import { Navbar, Nav} from 'react-bootstrap';
import { BrowserRouter, Route, Link,Router, Routes } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import LOGO from './img/LOGO.png';

import Beranda from './Beranda';
import Toko from './Toko';
import Aktivitas from './Aktivitas';
import About from './About';

class NavbarComp extends Component {
  render() {
    return (
      <Router>
      <div>
            <Navbar collapseOnSelect expand="lg" bg="success" variant="dark">
            <Container>
                <Navbar.Brand className='fw-bold' href="#home"><img className='mx-1' src={LOGO} width={40} height={40} alt='logo' />TernakSignature</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                  <Nav className="me-auto">
                  </Nav>
                  <Nav>
                      <Nav.Link  as={Link} to={"/beranda"} >Beranda</Nav.Link>
                      <Nav.Link  as={Link} to={"/toko"} >Toko</Nav.Link>
                      <Nav.Link  as={Link} to={"aktivitas"} >Aktivitas</Nav.Link>
                      <Nav.Link  as={Link} to={"/about"}>About Us</Nav.Link>
                  </Nav>
                </Navbar.Collapse>
            </Container>
            </Navbar>
      </div>
      <div>
        <BrowserRouter>

          <Routes>
            <Route path='/beranda' element={<Beranda/>} > </Route>
            <Route path='/toko' element={<Toko/>} ></Route>
            <Route path='/aktivitas' element={<Aktivitas/>} ></Route>
            <Route path='/about' element={<About/>}></Route>
          </Routes>
            
        </BrowserRouter>
      </div>
      </Router>
      
    )
  }
}

export default NavbarComp;
